            "कारक जीव: हा रोग Rhizoctonia solani Kuhn. द्वारे होतो, ज्याचा टेलीओमोर्फ Thanatephorus cucumeris आहे. हा रोग बी, माती आणि हवेच्या माध्यमातून पसरतो. तो मुळे, खालचे खोड (मातीच्या पातळीच्या खाली), खोड, पाने, देठ आणि शेंगांवर परिणाम करतो. भारतभर पसरलेला आहे, परंतु मध्य प्रदेश आणि उत्तरांचलमध्ये अधिक तीव्र आहे. तो 35% उत्पादन घट घडवू शकतो, जसे की पूर्व-उद्भव मरण, मुळे कुजणे, रोपं विझणे आणि प्रगत वनस्पतींमध्ये ब्लाइटमुळे कमी शेंगा आणि बीज तयार होतात. 24 ते 32°C तापमान श्रेणी आणि मातीतील 30-60 टक्के ओलावा मुळे कुजण्यास अनुकूल आहे. 70% मातीतील ओलावा, वाळूमिश्रित हलकी माती, आणि 6.6 पेक्षा जास्त pH असलेले मातीत रोपं विझण्याचे प्रमाण वाढते. पावसाळी किंवा ओलसर हवामानात हवाई ब्लाइट होण्याची शक्यता अधिक असते. सोयाबीनचे एकच पीक घेतल्यामुळे रोगाची तीव्रता वाढते."),
