        "rust_symptoms_text": MessageLookupByLibrary.simpleMessage(
            "1. On seedling and well-grown plants: Initially abundant chlorotic gray-brown minute spots of the size of the tip of a sewing needle appear in groups on the leaves, primarily on the lower surface. Slowly these spots increase in size and turn to tan to reddish-brown angular spots measuring 2 to 5 mm2 and later form pustules. Usually, the leaf tissues around the group of spots become yellow which distinguishes rust symptoms from bacterial pustule symptoms where leaf tissues around a single spot become chlorotic and yellow. Leaves turn brown within a short time causing early defoliation and reduction in the number of pods, seeds, and seed weight. The disease usually appears in small patches in the field then quickly spreads to the whole field. Presence of loose brown powder owing to the rupture of pustules is a characteristic symptom."),
